import React, { useEffect, useState } from "react";
import axios from "axios";
import { Row, Col, Container } from "react-bootstrap";

const Classes = () => {
  const [data, setData] = useState([]);
  const [loaded, setLoaded] = useState(false);

  const getData = async () => {
    await fetch("/drive/api")
      .then((res) => res.json())
      .then((res) => Object.assign({}, res.files[0]))
      .then((data) => {
        axios.post("/sheet/id", data);
      });

    await fetch("/sheet/api")
      .then((res) => res.json())
      .then((res) => setData(res))
      .then(setLoaded(true));
  };

  useEffect(() => {
    getData();
  }, []);

  const getClasses = () => {
    data.sheets.map((data) => {
      let className = data.properties.title;
      console.log(className);
    });
  };

  return (
    <Container className="classes text-center" fluid>
      <Row>
        <Col>
          <h3 style={{ color: "white", textAlign: "left" }}>Your Classes</h3>
        </Col>
      </Row>
    </Container>
  );
};

export default Classes;
